import React from 'react';
import Card from './Card';

function CardList({ pets, images }) {

	const items = [];

	pets.map((pet, i) => {
		images.map((img, j) => {
	  		items.push(<Card key={pets[i].id} img={'http//http://localhost:4412/api/file/' + images[j].url} name={pets[i].name} description={pets[i].description}/>);
		})
	})

	return (
		<div>
			{items}
		</div>
	);
}

export default CardList;

